import React from 'react';
import '../navbar.css';
import logo from '../images/Frame.svg';
import svg from '../images/Frame 45.svg';
import arrow from '../images/Vector.svg';
// import {Button} from 'react-bootstrap';
import Btn from './Button';

function NavBar(){
    return(
        <nav className='row'>
            <div className='col-2'>
                <img href="/" src={logo} alt='logo'/>
            </div>
            <ul className='col-4'>
                <li><a href='./'>Home</a></li>
                <li><a href='./'>Category</a></li>
                <li><a href='./'>About</a></li>
                <li><a href='./'>Contact</a></li>
            </ul>
            <form className='col-6'>
                <div className="input-box">
                    <i className="fa fa-search"></i>                    
                    <input type="text" className="form-control" placeholder='Search something here!'/>
                    <Btn className='Btn'>Join the community</Btn>

                    <div className='CountryDropdown'>
                        <img src={svg} alt='Svg'/>
                        <p>VND</p>
                        <img className='arrow' src={arrow} alt="arrow"/>
                    </div>
                 </div>
            </form>
        </nav>
    );
}

export default NavBar;
